text:
flashback
#oscar2018 hollywood's biggest night took time to deliver a timely message and celebrate diversity in filmmaking; 
ashley judd, salma hayek and annabella sciorra — three women who publicly accused harvey weinstein of sexual misconduct — took the stage together to introduce the segment.

when jimmy kimmel kicked off this year's oscars, he promised a "night of positivity" during his opening monologue. during the third act of sunday's show, that promise materialized when the academy devoted a segment to honoring the #metoo and time's up movements and highlighted the diversity in movie-making in the last year. "many spoke their truth and the journey ahead is long, but slowly a new path has emerged," said judd, referencing the women and men who have come forward to say #metoo and time's up. those voices have joined together to create a "mighty chorus," she added. judd shared a hope that the next 90 years of the academy awards will "empower these limitless possibilities of equality, diversity inclusivity, intersectionality — that's what this year has promised us." hayek then introduced a pre-taped segment highlighting some of this year's most diverse and ground-breaking filmmakers — from greta gerwig and dee rees to @ava duvernay and kumail nanjiani — whom she referred to as "unstoppable spirits who kicked ass and broke through bias perceptions against their gender racer and ethnicity to tell their stories." jimmy kimmel said : "we need to set an example and if we can work together here to stop sexual harassment in the workplace, women will only have to deal with harassment all the time, at every other place they go." perhaps speaking to critics of hollywood award shows who believe they have grown "too political," kimmel explained that the night's show would include brave and outspoken voices of the #metoo, #timesup and #neveragain movements in hopes of spurring positive change. "this is a night for positivity," he declared before rattling off all the names of nominees who had the potential to break or set new records if they were to win.

@mirasorvino #timesup : @ashleyjudd, @annabellsciorra & @salmahayek take the stage at the #oscars

