text:
when someone has been sexually violated, there is often a fear that abides within them about the perpetrator popping up outta nowhere and harming them again. this law will help keep victims informed about their violators whereabouts. see full context below...
the right to be notified about and present at proceedings;
the right to be heard at proceedings involving release, plea, sentencing, disposition, or parole of the accused;
the right to have the safety of the victim and victim's family considered when making bail or release decisions;
the right to be protected from the accused;
the right to be notified about release or escape of the accused;
the right to refuse an interview or deposition at the request of the accused;
the right to receive restitution from the individual who committed the criminal offense.
the model amendment states that the marsy's law definition of victim includes both the person directly harmed by a crime and "any spouse, parent, grandparent, child, sibling, grandchild, or guardian, and any person with a relationship to the victim that is substantially similar to a listed relationship.  #childsexabuseawareness #stopchildsexabuse #childsexabusesurvivor #parentsofchilldsexabusesurvivor #sexualassault #endchildsexabuse #endrapeculture #childabuse #sextrafficking #atlanta #atl #georgia #women #girls #teens #awareness #sexcrimes #rapevictims #rape #victims #children #prevention #trafficking  #survivor #tips #blogger #speaker #metoo #advocate

